import React, { Component } from "react";
import NavTop from "./nav_top";
import Breadcumps from "./breadcumps";
import Footer from "./footer";
import Table from "./tables";
import Nav from "./nav";
import User from "./users";

class wrapper extends Component {
  constructor(props) {
    super(props);
    this.state = { users: [] };
  }

  fetchData = () => {
    fetch("api/users")
      .then(res => res.json())
      .then(Users => {
        this.setState({ users: Users });
      });
  };

  componentDidMount() {
    this.fetchData();
  }

  render() {
    const ColumnData = {
      UserName: "UserName",
      Email: "Email",
      Telephone: "Telephone",
      Telephone: "Telephone"
    };
    return (
      <div id='wrapper'>
        <Nav />
        <div id='page-wrapper' className='gray-bg'>
          <NavTop />
          <Breadcumps tablename={"Users"} />
          {/* <User users={this.state.users} columns={ColumnData} /> */}
          <Table
            users={this.state.users}
            columns={ColumnData}
            onChange={e => this.fetchData(e)}
          />
          <Footer />
        </div>
      </div>
    );
  }
}

export default wrapper;
